import React from "react";

class SongList2 extends React.Component {

  render() {
    return (
      <tbody>
        <tr>
          <td>{this.props.index}</td>
          <td>{this.props.song.artist}</td>
          <td>{this.props.song.title}</td>
        </tr>
      </tbody>
    );
  }
}

export default SongList2;
